//Red Rider Race Report//

//AMERICAN FLAT TRACK//

In American Flat Track, Turner Honda's Henry Wiles @henry_w_wiles took home his 15th straight Peoria TT win, while Trevor Brunner @trevor_brunner11 had an unfortunate crash, resulting in a last-lap red flag that ended the race. Turner Honda's Cole Zabala @colezabala rounded out the podium with Brunner capturing fourth despite his crash. Wiles and Brunner hold fourth and sixth in the standings, respectively. Fun fact: red riders now hold places 10-15 in the standings. 

//AMA PRO MOTOCROSS//

The AMA Pro Motocross Championship returned to Budds Creek Motocross Park this weekend for the ninth round of the 2021 series. Continuing to show great speed, Team Honda HRC’s Ken Roczen @kenroczen94 qualified fastest before going on to take his CRF450R to victory in 450MX moto 1 and second in moto 2, for second overall. 

Chase Sexton @chasesexton powered to the podium in 450MX moto 1 and ended the day with a solid fourth overall via 3-4 moto results. Meanwhile, Team Honda HRC’s 250MX riders, Jett @jettson18 and Hunter Lawrence @hunterlawrence , finished second and fourth overall, respectively. 
@hondaracingcorporation #hondaracingcorporation

//NGPC//

SLR Honda's Cole Martinez @colemartinezz secured third in the Pro class at NGPC's muddy Cache Valley round in Preston, Idaho. Teammate Tallon LaFountaine @tallonlafountaine finished 12th in Pro II after running an impressive race but suffering an issue going into the last lap. In the morning race, Evan Stice @stice_316 rounded out the Open A podium.

