//Red Rider Race Report//

//AMA PRO MOTOCROSS//

The AMA Pro Motocross Championship kicked off its final stretch run of the 2021 season this weekend at Unadilla MX in New Berlin, New York.

@kenroczen94 rode to a flawless 1-1 sweep for his 2nd overall win of the season. @chasesexton was also impressive, securing 2nd place in 450MX moto 2, though a hard first-moto crash held him to fifth overall. @jettson18 prevailed in the 250MX class, achieving his 2nd victory of the season, via 2-1 moto results. Meanwhile, 5-11 finishes put @hunterlawrence , sixth overall in the same class. @hondaracingcorporation #hondaracingcorporation

//BITD//

Monster Energy Honda Team’s American rider @rickybrabec , with support by @jcrhonda , finished 2nd in the legendary Vegas to Reno. @hondaracingcorporation #hondaracingcorporation

During side-by-side racing in the Casey Folks Vegas to Reno event, Honda Talon Factory Racing driver Elias Hanna @elias_hanna740 took 4th in UTV Pro Naturally Aspirated and Zach Sizelove was 12th. Team owner  @proctor_race piloted his Honda Ridgeline to the top of the Class 7200 podium.

Team Raceco-USA's  @racecousainc captured the UTV Pure Stock win, and @eliottwatson3 was 13th in UTV Naturally Aspirated Pro.

//AMERICAN FLAT TRACK//

Turner Honda's @trevor_brunner11 had to settle for 2nd place at Weedsport Speedway in the AFT Singles class. Teammate  @henry_w_wiles also put in a good fight for the lead throughout the race. Red Riders did well at the event, taking not only the 2nd and 6th spots, but places 9-15. 

On the second day, 1st Impressions-backed Honda rider  @tannerdean38 took 6th place, and Brunner was 8th. Honda riders Kody Kopp, Tanner Dean, Cole Zabala, Kevin Stollings and Michael Inderbitzin hold places 10-14 in the standings, respectively. 

